import React from 'react';
import './App.css';
import onVacation from './img/logoOnvacationBlanco.png'
import queTeDetiene from './img/queTeDetiene.png'
import 'materialize-css/dist/css/materialize.min.css'
import  Noticias from './propaganda'
import Destino from './components/tarjeta_destino'


function losDestinos() {
  return(
    <Destino/>
  )
}



function App() {
  return (
    <div className="App">

      <div className= "onvacation_quetedetiene">

        <div>
          <figure>
          <img src = {onVacation} width= "330" alt = "logo On Vacation"/>          
       </figure>
        <hr></hr>
        <figure>
          <img src = {queTeDetiene} width = "270" alt = "logo que te detiene"/>
        </figure>
        <a className=" red darken-2 waves-effect waves-light btn" href = "home">Inicio</a>
        </div>        

      </div>


        <Noticias />




    </div>
  );
}

export default losDestinos;
